(1694, 'bd', '1. Download the skeleton file and fill it with data.', '1. কঙ্কাল ফাইলটি ডাউনলোড করুন এবং এটি ডেটা দিয়ে পূরণ করুন।', '2020-12-06 09:24:17', '2020-12-06 09:24:17'),
