(17373, 'lk', '1. Download the skeleton file and fill it with data.', '1. எலும்புக்கூடு கோப்பை பதிவிறக்கம் செய்து தரவு நிரப்பவும்.', '2020-12-07 03:24:36', '2020-12-07 03:24:36'),
(17374, 'lk', '2. You can download the example file to understand how the data must be filled.', '2. தரவு எவ்வாறு நிரப்பப்பட வேண்டும் என்பதைப் புரிந்து கொள்ள உதாரணக் கோப்பைப் பதிவிறக்கலாம்.', '2020-12-07 03:24:36', '2020-12-07 03:24:36'),
(17375, 'lk', '3. Once you have downloaded and filled the skeleton file, upload it in the form below and submit.', '3. நீங்கள் எலும்புக்கூடு கோப்பை பதிவிறக்கம் செய்து பூர்த்தி செய்தவுடன், அதை கீழே உள்ள படிவத்தில் பதிவேற்றி சமர்ப்பிக்கவும்.', '2020-12-07 03:24:36', '2020-12-07 03:24:36'),
(17376, 'lk', '4. After uploading products you need to edit them and set products images and choices.', '4. தயாரிப்புகளை பதிவேற்றிய பிறகு நீங்கள் அவற்றைத் திருத்த வேண்டும் மற்றும் தயாரிப்புகளின் படங்களையும் தேர்வுகளையும் அமைக்க வேண்டும்.', '2020-12-07 03:24:36', '2020-12-07 03:24:36'),
